import React from 'react'
import { useState } from 'react'
import data from '../../utils1/Products.json'
import ProductCard from '../ItemsList/ProductCard'
const AdminItems = () => {
    const [products,setProducts] = useState([...data])
  return (
    <div className='admin-items'>
       <h1 style={{textDecoration:"underline"}}>Items</h1>
       <div className='items-container innerWidth'>
     
 
     <div className='flexCenter'>  
             {/* <div className='flexCenter'>{itemList}</div> */}
             {
               products.length > 0 && products.map((product,index)=>{
                         return (
                                    
                                 <ProductCard key={index} product={product} />
                                
                                  
                         )
               })
             }
              </div>
     </div>;
    </div>
  )
}

export default AdminItems
